INSERT INTO FinalTable ( -- other columns, DATEOFSERVICE, -- other columns )\n   SELECT -- other columns,\n          CASE \n              WHEN DATEOFSERVICE = '00000000' THEN NULL -- or '1900-01-01' if you prefer a default date\n              ELSE CONVERT(DATETIME, STUFF(STUFF(DATEOFSERVICE, 5, 0, '-'), 8, 0, '-'))\n          END AS DATEOFSERVICE\n          -- other columns\n   FROM StagingTable;